    false,nt"url": null,nt"notes": "This narrative report for Bear River Migratory
    Bird Refuge outlines Refuge accomplishments from May through August of 1953. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, mammals, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses and Refuge visitors. N-R forms are attached.",nt"owner_org":
